                <div className="modal-dialog mw-100 w-75" role="document">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h5 className="modal-title" id="exampleModalLabel">Modal title</h5>
                            <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                                <span aria-hidden="true">Ã—</span>
                            </button>
                        </div>

                        <div className="modal-body">

                            {/* Begin */}
                            <div>
                                <div className="row pl-2 border-bottom">

                                    {/* Top Nav Bar */}
                                <div className="btn-group" role="group">
                                    <button type="button" class="btn btn-primary">User Details</button>
                                    <button type="button" class="btn btn-primary">Contact Information</button>
                                    <button type="button" class="btn btn-primary">User Details</button>

                                </div>
                                    

                                </div>
                                <div className="row">
                                    <div className="col-md-3 border-right overflow-auto mt-4">

                                        {/* List of all users that have been searched for */}

                                    </div>
                                    <div className="col mt-4">
                                        <div className="col-md-12">

                                            {/* Form to create a new student */}


                                        </div>
                                    </div>
                                </div>
                            </div>





                        </div>
                        <div className="modal-footer">
                            <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                            <button type="button" className="btn btn-primary">Save changes</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    editUser: state.editUser,
    editUserType: state.editUserType
})

export default connect(mapStateToProps, {})(EditUserAll);
